import React from "react";
import {Container} from 'react-bootstrap'

let ListAction = ({action, allgategory}) => {

    return (
        <div className="menu">
            <Container>
                <div className="text">Menu Food</div>
                <div>
                    <div className="actionMenu">
                    {
                        allgategory.map((gategoryTitle) => {
                            return (
                                <>
                                <span onClick={() => action("الكل")}>{gategoryTitle} </span>
                                <span onClick={() => action("فطار")}>{gategoryTitle} </span>
                                <span onClick={() => action("غدا")}>غدا</span>
                                <span onClick={() => action("العشاء")}>العشاء</span>
                                </>
                            )
                        })   
                    }
                    </div>
                </div>
            </Container>
        </div>
    )
}

export default ListAction
